import React from 'react';

import { MainView } from '../main-view/main-view';

export class BackButton extends React.Component {

  render() {
    const { button, onClick } = this.props;
    return (
      <div onClick={() => onClick(button)} className="main-view">Back

      </div>
    )
  }
}

